### Summary of Core Topics, Concepts, Principles, and Equations

#### Java Programming Concepts

1. **Generics**
   - **Concept**: Generics enable types (classes and interfaces) to be parameters when defining classes, interfaces, and methods.
   - **Example**: `public static <T extends Number> void findMax(Set<T> set)`
   - **Key Points**:
     - Type safety and reusability.
     - Bounded type parameters (`<T extends Number>`).

2. **Interfaces and Abstract Methods**
   - **Concept**: Interfaces define a contract that classes must follow. They can have abstract methods, default methods, and static methods.
   - **Example**:
     ```java
     interface Vehicle {
         public abstract int getMileage();
     }
     ```
   - **Key Points**:
     - Abstract methods must be implemented by the class.
     - Default methods provide a default implementation.
     - Static methods can be called without an instance.

3. **Inheritance and Polymorphism**
   - **Concept**: Inheritance allows a class to inherit properties and methods from another class. Polymorphism allows methods to perform different tasks based on the object that is acting upon them.
   - **Example**:
     ```java
     class Car implements Vehicle, Cloneable {
         // Implementation of methods
     }
     ```
   - **Key Points**:
     - `extends` and `implements` keywords.
     - Method overriding and overloading.

4. **Collections Framework**
   - **Concept**: The Collections Framework provides a unified architecture for representing and manipulating collections.
   - **Example**:
     ```java
     Set<Integer> s = new HashSet<>();
     s.add(12);
     s.add(23);
     ```
   - **Key Points**:
     - `List`, `Set`, and `Map` interfaces.
     - `ArrayList`, `HashSet`, and `TreeSet` implementations.

5. **Exception Handling**
   - **Concept**: Exception handling allows the program to handle runtime errors and maintain the normal flow of the application.
   - **Example**:
     ```java
     try {
         // Code that may throw an exception
     } catch (Exception e) {
         // Handle the exception
     }
     ```
   - **Key Points**:
     - `try`, `catch`, `finally` blocks.
     - `throw` and `throws` keywords.

6. **Streams API**
   - **Concept**: The Streams API provides a functional approach to processing sequences of elements.
   - **Example**:
     ```java
     Stream.iterate(50, p -> p - 5)
           .map(p -> p * 2)
           .filter(p -> p % 4 == 0)
           .limit(4)
           .forEach(p -> System.out.print(p + " "));
     ```
   - **Key Points**:
     - Intermediate operations (`map`, `filter`, `limit`).
     - Terminal operations (`forEach`).

7. **Type Erasure**
   - **Concept**: Type erasure is the process by which the compiler removes all information related to generic types.
   - **Example**:
     ```java
     public void calculateSum(Number[] marks) {
         // Calculates the sum of marks
     }
     ```
   - **Key Points**:
     - Generic types are replaced by their bound or `Object` if no bound is specified.

8. **Assertions**
   - **Concept**: Assertions are used to test assumptions in the code.
   - **Example**:
     ```java
     assert currentTemp >= -100 && currentTemp <= 150;
     ```
   - **Key Points**:
     - `assert` keyword.
     - Enabled with the `-ea` flag.

9. **Access Modifiers**
   - **Concept**: Access modifiers define the scope and visibility of classes, methods, and variables.
   - **Example**:
     ```java
     private void BMethod() {
         System.out.println("Method B");
     }
     ```
   - **Key Points**:
     - `public`, `private`, `protected`, and default (package-private) access modifiers.

10. **Cloning**
    - **Concept**: Cloning creates a copy of an object.
    - **Example**:
      ```java
      public Car clone() throws CloneNotSupportedException {
          return (Car) super.clone();
      }
      ```
    - **Key Points**:
      - `Cloneable` interface.
      - `clone()` method.

